The 'switch' statement in Java is used for evaluating a single variable and executing different blocks of code based on its value. It differs from using multiple 'if-else' statements in several ways:

1. **Readability**: The switch statement makes the code more readable by grouping related cases together, making it easier to understand the flow of the program.
2. **Efficiency**: In Java, the switch statement is more efficient than a series of if-else statements because it uses a jump table internally, which reduces the number of comparisons required.
3. **Maintainability**: The switch statement makes it easier to add or remove cases without affecting the rest of the code.

Here's an example of how you can use the switch statement in Java:

```java
int day = 2;
switch (day) {
    case 1:
        System.out.println("Monday");
        break;
    case 2:
        System.out.println("Tuesday");
        break;
    case 3:
        System.out.println("Wednesday");
        break;
    default:
        System.out.println("Invalid day");
}
```

In this example, the switch statement evaluates the value of `day` and prints out the corresponding day of the week.

